import Foundation

enum DrinkCategory: String, Codable {
    case cocktail = "Cocktail"
    case beer = "Beer"
    case wine = "Wine"
    case juice = "Juice"
    case nonAlcoholic = "Non-Alcoholic"
    // Adicione outras categorias conforme necessário
}

enum ServingTemperature: String, Codable {
    case hot = "Hot"
    case cold = "Cold"
    case roomTemperature = "Room Temperature"
}

enum Season: String, Codable {
    case spring = "Spring"
    case summer = "Summer"
    case autumn = "Autumn"
    case winter = "Winter"
}

struct NutritionalInfo: Hashable {
    var calories: Int?
    var sugarLevel: Int?
}

struct AlcoholInfo: Hashable {
    var hasAlcohol: Bool
    var alcoholContent: Double?
}

struct Drink: Hashable {
